import React from "react";
import profilePic from "../images/IMG_4334.jpg";

const About = () => {
  return (
    <div className="h-screen py-10 ">
      <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center">
        About Myself
      </h1>
      <div class>
        <div className="flex place-items-center justify-center">
          <img
            width={300}
            src={profilePic}
            alt="My profile picture"
            className=""
          />
          <div class="w-1/2 ml-60 ">
            <h1 className="text-xl dark:text-white text-black font-merriweather">
              Hi! I'm Bara. I am a second year undergrad student at the
              University of Toronto. I am currently pursuing a double major in
              Computer Science and Human Biology. My interests include reading,
              playing sports and working out.
            </h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
